    "import pandas as pd\n",
    "from pathlib import Path\n",
    "\n",
    "def create_comprehensive_naics_dataset(folder_path):\n",
    "    \"\"\"\n",
    "    Create comprehensive dataset with ALL NAICS industries from CSV files.\n",
    "    Includes all occupation-industry combinations for rich career forecasting.\n",
    "    Keeps ALL U.S. national data across all industries (no industry filtering).\n",
    "    \"\"\"\n",
    "    folder_path = Path(folder_path)\n",
    "    all_data = []\n",
    "    \n",
    "    # Process each year\n",
    "    years = [2018, 2019, 2020, 2021, 2022, 2023]\n",
    "    \n",
    "    print(\"🔄 Creating Comprehensive NAICS Dataset (All Industries)\")\n",
    "    print(\"=\" * 60)\n",
    "    print(\"📝 This script keeps ALL industries, not just cross-industry data\")\n",
    "    print(\"\")\n",
    "    \n",
    "    for year in years:\n",
    "        csv_file = folder_path / f\"all_data_M_{year}.csv\"\n",
    "        \n",
    "        if csv_file.exists():\n",
    "            print(f\"📊 Processing {year}...\")\n",
    "            \n",
    "            # Load CSV with proper data type handling\n",
    "            df = pd.read_csv(csv_file, low_memory=False, dtype={'naics': str, 'NAICS': str})\n",
    "            print(f\"  📖 Loaded: {df.shape[0]:,} rows, {df.shape[1]} columns\")\n",
    "            \n",
    "            # Standardize column names to uppercase\n",
    "            df.columns = df.columns.str.upper()\n",
    "            \n",
    "            # Add year column\n",
    "            df['YEAR'] = year\n",
    "            \n",
    "            # Filter to U.S. national data only (KEEP ALL INDUSTRIES)\n",
    "            us_data = df[df['AREA_TITLE'] == 'U.S.'].copy()\n",
    "            print(f\"  🇺🇸 U.S. national data: {len(us_data):,} records\")\n",
    "            \n",
    "            # Convert NAICS to string for consistency\n",
    "            us_data['NAICS'] = us_data['NAICS'].astype(str)\n",
    "            \n",
    "            # Show industry and occupation diversity\n",
    "            unique_industries = us_data['NAICS'].nunique()\n",
    "            unique_occupations = us_data['OCC_CODE'].nunique()\n",
    "            print(f\"  🏭 Unique industries (NAICS): {unique_industries:,}\")\n",
    "            print(f\"  👥 Unique occupations: {unique_occupations:,}\")\n",
    "            print(f\"  💼 Occupation-industry combinations: {len(us_data):,}\")\n",
    "            \n",
    "            # Sample of industries for verification\n",
    "            sample_industries = sorted(us_data['NAICS'].unique())[:5]\n",
    "            print(f\"  🔍 Sample NAICS codes: {sample_industries}\")\n",
    "            \n",
    "            # Add all U.S. data (no industry filtering)\n",
    "            all_data.append(us_data)\n",
    "            print(f\"  ✅ {year}: {len(us_data):,} records added (ALL industries)\")\n",
    "            print(\"\")\n",
    "            \n",
    "        else:\n",
    "            print(f\"  ❌ {year}: CSV file not found\")\n",
    "    \n",
    "    if not all_data:\n",
    "        print(\"❌ No data collected!\")\n",
    "        return None\n",
    "    \n",
    "    # Combine all years\n",
    "    print(f\"🔄 Combining {len(all_data)} years of comprehensive data...\")\n",
    "    combined_df = pd.concat(all_data, ignore_index=True)\n",
    "    print(f\"📊 Combined dataset: {len(combined_df):,} rows, {len(combined_df.columns)} columns\")\n",
    "    \n",
    "    # Select required columns for forecasting (handle case sensitivity)\n",
    "    required_columns = [\n",
    "        'YEAR',           # Year identifier (added by us)\n",
    "        'OCC_CODE',       # Occupation code\n",
    "        'OCC_TITLE',      # Occupation name\n",
    "        'O_GROUP',        # Occupation group level\n",
    "        'NAICS',          # Industry code\n",
    "        'NAICS_TITLE',    # Industry name\n",
    "        'I_GROUP',        # Industry group level\n",
    "        'TOT_EMP',        # Total employment\n",
    "        'PCT_TOTAL',      # Percent of total industry employment\n",
    "        'A_MEAN',         # Mean annual salary\n",
    "        'A_MEDIAN',       # Median annual salary\n",
    "        'A_PCT25',        # 25th percentile salary\n",
    "        'A_PCT75'         # 75th percentile salary\n",
    "    ]\n",
    "    \n",
    "    # Handle case sensitivity - map actual column names to required names\n",
    "    print(\"🔍 Selecting required columns and handling case differences...\")\n",
    "    column_mapping = {}\n",
    "    available_columns = []\n",
    "    missing_columns = []\n",
    "    \n",
    "    for required_col in required_columns:\n",
    "        found = False\n",
    "        \n",
    "        # Check exact match first (for 2020-2023 uppercase)\n",
    "        if required_col in combined_df.columns:\n",
    "            column_mapping[required_col] = required_col\n",
    "            available_columns.append(required_col)\n",
    "            found = True\n",
    "        # Check lowercase version (for 2018-2019)\n",
    "        elif required_col.lower() in combined_df.columns:\n",
    "            column_mapping[required_col.lower()] = required_col\n",
    "            available_columns.append(required_col)\n",
    "            found = True\n",
    "            print(f\"  📝 Mapped: {required_col.lower()} → {required_col}\")\n",
    "        \n",
    "        if not found:\n",
    "            missing_columns.append(required_col)\n",
    "    \n",
    "    if missing_columns:\n",
    "        print(f\"⚠️ Missing columns: {missing_columns}\")\n",
    "        print(f\"📋 Available columns sample: {list(combined_df.columns)[:15]}\")\n",
    "    \n",
    "    # Rename columns to standardize (lowercase → uppercase)\n",
    "    if column_mapping:\n",
    "        combined_df = combined_df.rename(columns=column_mapping)\n",
