    "print(f\"💼 Occupation-Industry Combinations: {df.groupby(['OCC_CODE', 'NAICS']).size().shape[0]:,}\")\n",
    "print(f\"📊 Memory Usage: {df.memory_usage(deep=True).sum() / 1024 / 1024:.1f} MB\")\n",
