    "print(\"Columns and data types:\")\n",
    "for i, (col, dtype) in enumerate(df.dtypes.items(), 1):\n",
    "    null_count = df[col].isnull().sum()\n",
    "    null_pct = (null_count / len(df)) * 100\n",
    "    print(f\"{i:2d}. {col:<12} | {str(dtype):<10} | Nulls: {null_count:>6,} ({null_pct:>5.1f}%)\")\n",
