    "\n",
    "# ============================================================================\n",
    "# TOP OCCUPATIONS AND INDUSTRIES\n",
    "# ============================================================================\n",
    "\n",
    "print(\"\\n👥 TOP 15 OCCUPATIONS BY RECORD COUNT\")\n",
