    "    occ_title_short = occ_title[:40] + \"...\" if len(occ_title) > 40 else occ_title\n",
    "    print(f\"{i:2d}. {occ_code} | {occ_title_short:<40} | {count:>4} records\")\n",
    "\n",
    "print(\"\\n🏭 TOP 15 INDUSTRIES BY RECORD COUNT\")\n",
    "print(\"=\" * 40)\n",
    "industry_counts = df['NAICS_TITLE'].value_counts().head(15)\n",
    "for i, (industry, count) in enumerate(industry_counts.items(), 1):\n",
    "    industry_short = industry[:50] + \"...\" if len(industry) > 50 else industry\n",
    "    print(f\"{i:2d}. {industry_short:<50} | {count:>6} records\")\n",
