    "import pandas as pd\n",
    "import numpy as np\n",
    "\n",
    "print(\"🎯 CORRECT MISSING VALUE STRATEGY\")\n",
    "print(\"=\" * 45)\n",
    "print(\"Key Principle: Keep ALL data, handle missing values appropriately by use case\")\n",
    "print()\n",
    "\n",
    "# Load the comprehensive dataset\n",
    "df = pd.read_csv(\"comprehensive_naics_dataset_2018_2023.csv\")\n",
    "print(f\"📊 Original dataset: {len(df):,} rows\")\n",
    "print()\n",
    "\n",
    "# Analyze missing data\n",
    "print(\"🔍 MISSING DATA ANALYSIS\")\n",
    "print(\"=\" * 30)\n",
    "missing_analysis = df.isnull().sum()\n",
    "total_rows = len(df)\n",
    "\n",
    "key_columns = ['TOT_EMP', 'A_MEAN', 'A_MEDIAN', 'A_PCT25', 'A_PCT75', 'PCT_TOTAL']\n",
    "for col in key_columns:\n",
    "    if col in df.columns:\n",
    "        missing_count = missing_analysis[col]\n",
    "        missing_pct = (missing_count / total_rows) * 100\n",
    "        print(f\"{col:<10}: {missing_count:>6,} ({missing_pct:>5.1f}%)\")\n",
    "print()\n",
    "\n",
    "print(\"💡 CORRECT UNDERSTANDING:\")\n",
    "print(\"• Target variables with missing values are NOT removed from dataset\")\n",
    "print(\"• They are excluded ONLY when training that specific model\")\n",
    "print(\"• We can still make predictions for rows with missing targets\")\n",
    "print(\"• The goal is to KEEP maximum data for comprehensive analysis\")\n",
    "print()\n",
    "\n",
    "# Strategy: Handle ALL missing values appropriately\n",
    "print(\"🔧 COMPREHENSIVE MISSING VALUE HANDLING\")\n",
    "print(\"=\" * 50)\n",
    "\n",
    "# Create a complete working dataset\n",
    "df_complete = df.copy()\n",
    "\n",
    "# 1. Handle PCT_TOTAL (feature variable - 9.3% missing)\n",
    "print(\"1. Handling PCT_TOTAL (feature variable):\")\n",
    "if 'PCT_TOTAL' in df_complete.columns:\n",
    "    pct_missing_before = df_complete['PCT_TOTAL'].isna().sum()\n",
    "    \n",
    "    # Create missing indicator\n",
    "    df_complete['PCT_TOTAL_MISSING'] = df_complete['PCT_TOTAL'].isna().astype(int)\n",
    "    \n",
    "    # Impute with industry group median\n",
    "    df_complete['PCT_TOTAL_IMPUTED'] = df_complete.groupby('I_GROUP')['PCT_TOTAL'].transform(\n",
    "        lambda x: x.fillna(x.median())\n",
    "    )\n",
    "    \n",
    "    # Handle any remaining missing with overall median\n",
    "    overall_median = df_complete['PCT_TOTAL'].median()\n",
    "    df_complete['PCT_TOTAL_IMPUTED'] = df_complete['PCT_TOTAL_IMPUTED'].fillna(overall_median)\n",
    "    \n",
    "    pct_missing_after = df_complete['PCT_TOTAL_IMPUTED'].isna().sum()\n",
    "    print(f\"   Before: {pct_missing_before:,} missing\")\n",
    "    print(f\"   After: {pct_missing_after:,} missing\")\n",
    "    print(f\"   ✅ Created: PCT_TOTAL_IMPUTED + PCT_TOTAL_MISSING flag\")\n",
    "    print()\n",
    "\n",
    "# 2. Handle salary percentiles (feature variables)\n",
    "print(\"2. Handling salary percentiles (feature variables):\")\n",
    "salary_percentiles = ['A_PCT25', 'A_PCT75']\n",
    "for col in salary_percentiles:\n",
    "    if col in df_complete.columns:\n",
    "        missing_before = df_complete[col].isna().sum()\n",
    "        \n",
    "        # Impute using relationship with A_MEDIAN\n",
    "        if col == 'A_PCT25':\n",
    "            # 25th percentile ≈ 80% of median\n",
    "            df_complete[f'{col}_IMPUTED'] = df_complete[col].fillna(df_complete['A_MEDIAN'] * 0.8)\n",
    "        elif col == 'A_PCT75':\n",
    "            # 75th percentile ≈ 120% of median\n",
    "            df_complete[f'{col}_IMPUTED'] = df_complete[col].fillna(df_complete['A_MEDIAN'] * 1.2)\n",
    "        \n",
    "        # Create missing flag\n",
    "        df_complete[f'{col}_MISSING'] = df_complete[col].isna().astype(int)\n",
    "        \n",
    "        missing_after = df_complete[f'{col}_IMPUTED'].isna().sum()\n",
    "        print(f\"   {col}: {missing_before:,} → {missing_after:,} missing\")\n",
    "        print(f\"   ✅ Created: {col}_IMPUTED + {col}_MISSING flag\")\n",
    "\n",
    "print()\n",
    "\n",
    "# 3. Handle A_MEAN (can be feature or alternative target)\n",
    "print(\"3. Handling A_MEAN (potential feature/alternative target):\")\n",
    "if 'A_MEAN' in df_complete.columns:\n",
    "    amean_missing = df_complete['A_MEAN'].isna().sum()\n",
    "    \n",
    "    # Can impute A_MEAN from A_MEDIAN (mean is usually higher than median)\n",
    "    df_complete['A_MEAN_IMPUTED'] = df_complete['A_MEAN'].fillna(df_complete['A_MEDIAN'] * 1.1)\n",
    "    df_complete['A_MEAN_MISSING'] = df_complete['A_MEAN'].isna().astype(int)\n",
    "    \n",
    "    amean_after = df_complete['A_MEAN_IMPUTED'].isna().sum()\n",
    "    print(f\"   Before: {amean_missing:,} missing\")\n",
    "    print(f\"   After: {amean_after:,} missing\")\n",
    "    print(f\"   ✅ Created: A_MEAN_IMPUTED + A_MEAN_MISSING flag\")\n",
    "    print()\n",
    "\n",
    "# 4. TARGET VARIABLES - Keep as-is with clear documentation\n",
    "print(\"4. TARGET VARIABLES - Special Handling:\")\n",
    "print(\"   TOT_EMP (Employment target):\")\n",
    "emp_missing = df_complete['TOT_EMP'].isna().sum()\n",
    "emp_available = df_complete['TOT_EMP'].notna().sum()\n",
    "print(f\"     Missing: {emp_missing:,} ({(emp_missing/len(df_complete))*100:.1f}%)\")\n",
    "print(f\"     Available for training: {emp_available:,} ({(emp_available/len(df_complete))*100:.1f}%)\")\n",
    "print(\"     ✅ Keep as-is - exclude from training only when building employment model\")\n",
    "\n",
    "print(\"   A_MEDIAN (Salary target):\")  \n",
    "sal_missing = df_complete['A_MEDIAN'].isna().sum()\n",
    "sal_available = df_complete['A_MEDIAN'].notna().sum()\n",
    "print(f\"     Missing: {sal_missing:,} ({(sal_missing/len(df_complete))*100:.1f}%)\")\n",
    "print(f\"     Available for training: {sal_available:,} ({(sal_available/len(df_complete))*100:.1f}%)\")\n",
    "print(\"     ✅ Keep as-is - exclude from training only when building salary model\")\n",
    "print()\n",
    "\n",
    "# Show the complete dataset statistics\n",
    "print(\"📊 COMPLETE DATASET STATISTICS\")\n",
    "print(\"=\" * 35)\n",
    "print(f\"📊 Total records: {len(df_complete):,} (NO DATA LOSS!)\")\n",
    "print(f\"📅 Years: {sorted(df_complete['YEAR'].unique())}\")\n",
    "print(f\"👥 Occupations: {df_complete['OCC_CODE'].nunique():,}\")\n",
    "print(f\"🏭 Industries: {df_complete['NAICS'].nunique():,}\")\n",
    "print(f\"💼 Combinations: {df_complete.groupby(['OCC_CODE', 'NAICS']).size().shape[0]:,}\")\n",
    "print()\n",
    "\n",
    "# Show model-specific data availability\n",
    "print(\"📈 MODEL-SPECIFIC DATA AVAILABILITY\")\n",
    "print(\"=\" * 40)\n",
    "\n",
    "employment_trainable = df_complete['TOT_EMP'].notna().sum()\n",
    "salary_trainable = df_complete['A_MEDIAN'].notna().sum()\n",
    "both_available = df_complete[['TOT_EMP', 'A_MEDIAN']].notna().all(axis=1).sum()\n",
    "\n",
    "print(f\"Employment Model:\")\n",
    "print(f\"  Can train on: {employment_trainable:,} records ({(employment_trainable/len(df_complete))*100:.1f}%)\")\n",
    "print(f\"  Can predict for: {len(df_complete):,} records (100%)\")\n",
    "\n",
    "print(f\"Salary Model:\")\n",
    "print(f\"  Can train on: {salary_trainable:,} records ({(salary_trainable/len(df_complete))*100:.1f}%)\")\n",
    "print(f\"  Can predict for: {len(df_complete):,} records (100%)\")\n",
    "\n",
    "print(f\"Dual Model (both targets):\")\n",
    "print(f\"  Can train on: {both_available:,} records ({(both_available/len(df_complete))*100:.1f}%)\")\n",
    "print()\n",
    "\n",
    "# Save the complete dataset\n",
    "print(\"💾 SAVING COMPLETE DATASET\")\n",
    "print(\"=\" * 30)\n",
    "\n",
    "output_filename = \"complete_forecasting_dataset.csv\"\n",
    "df_complete.to_csv(output_filename, index=False)\n",
    "\n",
    "print(f\"✅ Saved: {output_filename}\")\n",
    "print(f\"📊 Size: {len(df_complete):,} rows × {len(df_complete.columns)} columns\")\n",
    "print(f\"🎯 Ready for comprehensive forecasting with maximum data retention\")\n",
    "print()\n",
    "\n",
    "# Usage examples\n",
    "print(\"🎯 HOW TO USE FOR MODEL TRAINING\")\n",
    "print(\"=\" * 40)\n",
    "\n",
    "print(\"Employment Model Training:\")\n",
    "print(\"```python\")\n",
    "print(\"df = pd.read_csv('complete_forecasting_dataset.csv')\")\n",
