    "        row=3, col=1\n",
    "    )\n",
    "    \n",
    "    # 6. Technology jobs comparison\n",
    "    tech_jobs = []\n",
    "    for data in occupations.values():\n",
    "        title_lower = data['title'].lower()\n",
    "        if any(word in title_lower for word in ['software', 'computer', 'data', 'developer', 'programmer']):\n",
    "            tech_jobs.append({\n",
    "                'title': data['title'],\n",
    "                'growth': data['growth_total_percent'],\n",
    "                'employment': data['current_employment']\n",
    "            })\n",
    "    \n",
    "    tech_jobs = sorted(tech_jobs, key=lambda x: x['growth'], reverse=True)[:8]\n",
    "    \n",
    "    if tech_jobs:\n",
    "        fig.add_trace(\n",
    "            go.Bar(\n",
    "                x=[job['growth'] for job in tech_jobs],\n",
    "                y=[job['title'][:25] + '...' if len(job['title']) > 25 else job['title'] for job in tech_jobs],\n",
    "                orientation='h',\n",
    "                name='Tech Jobs Growth',\n",
    "                marker_color='#85CB33',\n",
    "                text=[f\"+{rate:.1f}%\" for rate in [job['growth'] for job in tech_jobs]],\n",
    "                textposition='auto'\n",
    "            ),\n",
    "            row=3, col=2\n",
