    "# ============================================================================\n",
    "# PHASE 2 - ENHANCED SEARCH FUNCTIONALITY FOR CAREER DATABASE\n",
    "# ============================================================================\n",
    "\n",
    "import json\n",
    "import re\n",
    "from difflib import SequenceMatcher\n",
    "\n",
    "print(\"🔍 ENHANCED SEARCH FUNCTIONALITY FOR CAREER DATABASE\")\n",
    "print(\"=\" * 55)\n",
    "\n",
    "# ============================================================================\n",
    "# DATABASE LOADING AND SEARCH FUNCTIONS\n",
    "# ============================================================================\n",
    "\n",
    "def load_database(filename='complete_employment_forecasts.json'):\n",
    "    \"\"\"Load the employment forecasts database\"\"\"\n",
    "    try:\n",
    "        with open(filename, 'r') as f:\n",
    "            database = json.load(f)\n",
    "        print(f\"✅ Database loaded: {database['metadata']['total_occupations']:,} occupations\")\n",
    "        return database\n",
    "    except FileNotFoundError:\n",
    "        print(f\"❌ Database file not found: {filename}\")\n",
    "        return None\n",
    "\n",
    "def enhanced_job_search(database, search_query, limit=10):\n",
    "    \"\"\"Enhanced search with multiple matching strategies\"\"\"\n",
    "    \n",
    "    if not database:\n",
    "        return []\n",
    "    \n",
    "    search_term = search_query.lower().strip()\n",
    "    if len(search_term) < 2:\n",
    "        return []\n",
    "    \n",
    "    occupations = database['occupations']\n",
    "    matches = []\n",
    "    \n",
    "    for occ_code, job_data in occupations.items():\n",
    "        title = job_data['title'].lower()\n",
    "        relevance_score = 0\n",
    "        match_type = \"\"\n",
    "        \n",
    "        # 1. Exact phrase match (highest priority)\n",
    "        if search_term in title:\n",
    "            relevance_score += 20\n",
    "            match_type = \"Exact match\"\n",
    "        \n",
    "        # 2. Word matching with different weights\n",
    "        search_words = search_term.split()\n",
    "        title_words = title.split()\n",
    "        \n",
    "        matched_words = 0\n",
    "        for search_word in search_words:\n",
    "            if len(search_word) > 2:  # Skip very short words\n",
    "                for title_word in title_words:\n",
    "                    # Exact word match\n",
    "                    if search_word == title_word:\n",
    "                        relevance_score += 15\n",
    "                        matched_words += 1\n",
    "                    # Partial word match (for plurals, etc.)\n",
    "                    elif search_word in title_word or title_word in search_word:\n",
    "                        if len(search_word) > 3:  # Avoid false matches on short words\n",
    "                            relevance_score += 8\n",
    "                            matched_words += 1\n",
    "        \n",
    "        # 3. Fuzzy matching for common misspellings\n",
    "        if relevance_score == 0:  # Only if no exact matches\n",
    "            similarity = SequenceMatcher(None, search_term, title).ratio()\n",
    "            if similarity > 0.6:  # 60% similarity threshold\n",
    "                relevance_score += int(similarity * 10)\n",
    "                match_type = \"Similar\"\n",
    "        \n",
    "        # 4. Occupation code matching\n",
    "        if search_term in occ_code.lower():\n",
    "            relevance_score += 5\n",
    "            match_type = \"Code match\"\n",
    "        \n",
    "        # 5. Special handling for common search patterns\n",
    "        special_matches = {\n",
    "            'data scientist': ['data', 'scientist', 'analytics', 'research'],\n",
    "            'software developer': ['software', 'developer', 'programmer'],\n",
    "            'web developer': ['web', 'developer', 'programmer'],\n",
    "            'machine learning': ['machine', 'learning', 'artificial', 'intelligence'],\n",
    "            'cyber security': ['cyber', 'security', 'information', 'security'],\n",
    "            'project manager': ['project', 'manager', 'program', 'manager']\n",
    "        }\n",
    "        \n",
    "        for pattern, keywords in special_matches.items():\n",
    "            if search_term == pattern or any(word in search_term for word in pattern.split()):\n",
    "                keyword_matches = sum(1 for keyword in keywords if keyword in title)\n",
    "                if keyword_matches >= 2:  # At least 2 keywords match\n",
    "                    relevance_score += 12\n",
    "                    match_type = \"Pattern match\"\n",
    "        \n",
    "        # Add to matches if relevant\n",
    "        if relevance_score > 0:\n",
    "            matches.append({\n",
    "                'occ_code': occ_code,\n",
    "                'title': job_data['title'],\n",
    "                'current_employment': job_data['current_employment'],\n",
    "                'growth_rate': round(job_data['growth_total_percent'], 1),\n",
    "                'forecast_2030': job_data['forecast_2030'],\n",
    "                'quality': job_data['quality_rating'],\n",
    "                'confidence': job_data['confidence_level'],\n",
    "                'recommendation': job_data['recommendation'],\n",
    "                'accuracy_mape': job_data['accuracy_mape'],\n",
    "                'relevance_score': relevance_score,\n",
    "                'match_type': match_type\n",
    "            })\n",
    "    \n",
    "    # Sort by relevance score (highest first), then by employment size\n",
    "    matches.sort(key=lambda x: (-x['relevance_score'], -x['current_employment']))\n",
    "    \n",
    "    return matches[:limit]\n",
    "\n",
    "# ============================================================================\n",
    "# DATABASE ANALYSIS FUNCTIONS\n",
    "# ============================================================================\n",
    "\n",
    "def analyze_search_coverage(database):\n",
    "    \"\"\"Analyze what types of jobs are covered in the database\"\"\"\n",
    "    \n",
    "    occupations = database['occupations']\n",
    "    \n",
    "    # Category analysis\n",
    "    categories = {\n",
    "        'Technology': ['software', 'computer', 'data', 'web', 'programmer', 'developer', 'analyst', 'engineer', 'systems'],\n",
    "        'Healthcare': ['nurse', 'medical', 'health', 'physician', 'doctor', 'therapist', 'technician'],\n",
    "        'Education': ['teacher', 'instructor', 'professor', 'education', 'tutor', 'librarian'],\n",
    "        'Business': ['manager', 'executive', 'business', 'financial', 'marketing', 'sales', 'consultant'],\n",
    "        'Engineering': ['engineer', 'engineering', 'mechanical', 'electrical', 'civil', 'chemical'],\n",
    "        'Arts & Design': ['artist', 'designer', 'graphic', 'interior', 'fashion', 'photographer'],\n",
    "        'Legal': ['lawyer', 'attorney', 'legal', 'paralegal', 'judge'],\n",
    "        'Finance': ['financial', 'accountant', 'banker', 'analyst', 'advisor'],\n",
    "        'Science': ['scientist', 'researcher', 'biologist', 'chemist', 'physicist', 'geologist']\n",
    "    }\n",
    "    \n",
    "    category_counts = {}\n",
    "    \n",
    "    for category, keywords in categories.items():\n",
    "        count = 0\n",
    "        jobs = []\n",
    "        \n",
    "        for job_data in occupations.values():\n",
    "            title_lower = job_data['title'].lower()\n",
    "            if any(keyword in title_lower for keyword in keywords):\n",
    "                count += 1\n",
    "                jobs.append({\n",
    "                    'title': job_data['title'],\n",
    "                    'growth': job_data['growth_total_percent'],\n",
    "                    'employment': job_data['current_employment']\n",
    "                })\n",
    "        \n",
    "        # Sort by employment size\n",
    "        jobs.sort(key=lambda x: x['employment'], reverse=True)\n",
    "        category_counts[category] = {\n",
    "            'count': count,\n",
    "            'top_jobs': jobs[:5]  # Top 5 by employment\n",
    "        }\n",
    "    \n",
    "    return category_counts\n",
    "\n",
    "def test_comprehensive_searches(database):\n",
    "    \"\"\"Test comprehensive search functionality\"\"\"\n",
    "    \n",
    "    print(\"🔍 COMPREHENSIVE SEARCH TESTING\")\n",
