    "        # Education\n",
    "        'teacher', 'professor', 'instructor', 'librarian',\n",
    "        \n",
    "        # Engineering\n",
    "        'mechanical engineer', 'electrical engineer', 'civil engineer',\n",
    "        \n",
    "        # Other popular searches\n",
