    "        if results:\n",
    "            for i, result in enumerate(results[:3], 1):\n",
    "                print(f\"   {i}. {result['title'][:50]}...\")\n",
    "                print(f\"      Growth: {result['growth_rate']:+.1f}% | {result['recommendation'].split()[0]} | {result['match_type']}\")\n",
    "        else:\n",
    "            print(\"   ❌ No matches found\")\n",
    "    \n",
    "    return search_results\n",
    "\n",
    "def create_search_improvements_report(database, search_results):\n",
    "    \"\"\"Create a report on search improvements\"\"\"\n",
    "    \n",
    "    print(f\"\\n📊 SEARCH IMPROVEMENT ANALYSIS\")\n",
    "    print(\"=\" * 35)\n",
    "    \n",
    "    total_searches = len(search_results)\n",
    "    successful_searches = sum(1 for results in search_results.values() if results)\n",
    "    \n",
    "    print(f\"📈 Search Success Rate: {successful_searches}/{total_searches} ({successful_searches/total_searches*100:.1f}%)\")\n",
    "    \n",
    "    # Find searches with no results\n",
    "    failed_searches = [term for term, results in search_results.items() if not results]\n",
    "    if failed_searches:\n",
    "        print(f\"\\n❌ Searches with no results:\")\n",
    "        for term in failed_searches:\n",
    "            print(f\"   • '{term}'\")\n",
    "    \n",
    "    # Find highly successful searches\n",
    "    excellent_searches = [term for term, results in search_results.items() if len(results) >= 3]\n",
    "    print(f\"\\n✅ Searches with 3+ results: {len(excellent_searches)}\")\n",
    "    \n",
    "    # Category coverage analysis\n",
    "    category_coverage = analyze_search_coverage(database)\n",
    "    \n",
    "    print(f\"\\n📋 CAREER CATEGORY COVERAGE:\")\n",
    "    for category, data in category_coverage.items():\n",
    "        print(f\"\\n{category}: {data['count']} jobs\")\n",
    "        for job in data['top_jobs'][:3]:\n",
    "            print(f\"   • {job['title'][:45]}... ({job['employment']:,.0f} jobs, {job['growth']:+.1f}%)\")\n",
    "\n",
