    "    print(\"=\" * 30)\n",
    "    print(\"Test any search term (type 'quit' to exit):\")\n",
    "    \n",
    "    while True:\n",
    "        search_input = input(\"\\nEnter search term: \").strip()\n",
    "        \n",
    "        if search_input.lower() in ['quit', 'exit', 'q']:\n",
    "            break\n",
    "        \n",
    "        if search_input:\n",
    "            results = enhanced_job_search(database, search_input, limit=10)\n",
