    "                print(f\"   📋 Quality: {result['quality']} ({result['accuracy_mape']:.1f}% MAPE)\")\n",
    "                print(f\"   🔍 Match Type: {result['match_type']}\")\n",
    "\n",
    "# ============================================================================\n",
    "# WEBSITE INTEGRATION FUNCTIONS\n",
    "# ============================================================================\n",
    "\n",
    "def create_website_search_api(database_file='complete_employment_forecasts.json'):\n",
    "    \"\"\"Create website-ready search functions\"\"\"\n",
    "    \n",
    "    # Load database once at startup\n",
    "    with open(database_file, 'r') as f:\n",
    "        database = json.load(f)\n",
    "    \n",
    "    def search_careers(query, limit=20):\n",
    "        \"\"\"API function for website career search\"\"\"\n",
    "        return enhanced_job_search(database, query, limit)\n",
    "    \n",
    "    def get_career_details(occ_code):\n",
    "        \"\"\"API function to get specific career details\"\"\"\n",
    "        if occ_code in database['occupations']:\n",
    "            job_data = database['occupations'][occ_code]\n",
    "            \n",
    "            # Format for website display\n",
    "            return {\n",
    "                'title': job_data['title'],\n",
    "                'current_employment': f\"{job_data['current_employment']:,}\",\n",
    "                'forecast_2030': f\"{job_data['forecast_2030']:,}\",\n",
    "                'growth_rate': f\"{job_data['growth_total_percent']:+.1f}%\",\n",
    "                'recommendation': job_data['recommendation'],\n",
    "                'student_advice': job_data['student_advice'],\n",
    "                'quality_rating': job_data['quality_rating'],\n",
    "                'confidence_level': job_data['confidence_level'],\n",
    "                'accuracy': f\"{job_data['accuracy_mape']:.1f}% MAPE\",\n",
    "                'forecasting_method': job_data['method'],\n",
    "                'historical_data': job_data['historical_data'],\n",
    "                'annual_forecasts': [\n",
    "                    {\n",
    "                        'year': year,\n",
    "                        'employment': f\"{forecast:,.0f}\",\n",
    "                        'lower_bound': f\"{lower:,.0f}\",\n",
    "                        'upper_bound': f\"{upper:,.0f}\"\n",
    "                    }\n",
    "                    for year, forecast, lower, upper in zip(\n",
    "                        job_data['forecast_years'],\n",
    "                        job_data['forecasts'],\n",
    "                        job_data['lower_bounds'],\n",
    "                        job_data['upper_bounds']\n",
    "                    )\n",
    "                ]\n",
    "            }\n",
    "        return None\n",
    "    \n",
    "    def get_popular_searches():\n",
    "        \"\"\"Get popular career searches with quick stats\"\"\"\n",
    "        popular_terms = [\n",
    "            'software developer', 'data scientist', 'nurse', 'teacher', \n",
    "            'engineer', 'manager', 'analyst', 'designer'\n",
    "        ]\n",
    "        \n",
    "        results = {}\n",
    "        for term in popular_terms:\n",
    "            matches = enhanced_job_search(database, term, limit=3)\n",
    "            if matches:\n",
    "                results[term] = {\n",
    "                    'count': len(enhanced_job_search(database, term, limit=100)),\n",
    "                    'top_match': matches[0]\n",
    "                }\n",
    "        \n",
    "        return results\n",
    "    \n",
    "    return search_careers, get_career_details, get_popular_searches\n",
