    "def _analyze_salary_ranges(cross_industry):\n",
    "    \"\"\"Analyze salary ranges and distribution\"\"\"\n",
    "    \n",
    "    print(f\"\\n💰 SALARY RANGE ANALYSIS:\")\n",
    "    print(\"=\" * 25)\n",
    "    \n",
    "    salary_data = cross_industry[cross_industry['A_MEDIAN'].notna()]\n",
    "    \n",
    "    print(f\"📊 Salary records: {len(salary_data):,}\")\n",
