    "        '$50K-$75K': len(salary_data[(salary_data['A_MEDIAN'] >= 50000) & (salary_data['A_MEDIAN'] < 75000)]),\n",
    "        '$75K-$100K': len(salary_data[(salary_data['A_MEDIAN'] >= 75000) & (salary_data['A_MEDIAN'] < 100000)]),\n",
    "        'Over $100K': len(salary_data[salary_data['A_MEDIAN'] >= 100000])\n",
    "    }\n",
    "    \n",
    "    print(f\"\\n📊 Salary Distribution:\")\n",
    "    for range_name, count in salary_ranges.items():\n",
    "        percentage = (count / len(salary_data)) * 100\n",
    "        print(f\"   {range_name}: {count:,} jobs ({percentage:.1f}%)\")\n",
    "\n",
    "\n",
    "def _analyze_data_quality(cross_industry):\n",
    "    \"\"\"Analyze data quality factors for salary forecasting\"\"\"\n",
    "    \n",
    "    print(f\"\\n📋 SALARY FORECASTING QUALITY FACTORS:\")\n",
    "    print(\"=\" * 40)\n",
    "    \n",
    "    salary_data = cross_industry[cross_industry['A_MEDIAN'].notna()]\n",
    "    \n",
    "    # Check for reasonable salary values\n",
    "    reasonable_salaries = salary_data[\n",
    "        (salary_data['A_MEDIAN'] >= 15000) & \n",
    "        (salary_data['A_MEDIAN'] <= 500000)\n",
    "    ]\n",
    "    \n",
    "    reasonable_percentage = (len(reasonable_salaries) / len(salary_data)) * 100\n",
    "    print(f\"✅ Reasonable salary values: {len(reasonable_salaries):,}/{len(salary_data):,} ({reasonable_percentage:.1f}%)\")\n",
    "    \n",
    "    # Years of data available\n",
    "    years_available = sorted(salary_data['YEAR'].unique())\n",
    "    print(f\"📅 Years of salary data: {years_available}\")\n",
    "    print(f\"📊 Data span: {len(years_available)} years\")\n",
    "    \n",
    "    # High-paying jobs sample\n",
    "    print(f\"\\n💎 HIGH-PAYING JOBS SAMPLE (>$100K):\")\n",
    "    print(\"=\" * 35)\n",
    "    \n",
    "    high_paying = salary_data[salary_data['A_MEDIAN'] > 100000].copy()\n",
    "    if len(high_paying) > 0:\n",
    "        top_paying = high_paying.groupby('OCC_TITLE')['A_MEDIAN'].mean().sort_values(ascending=False).head(5)\n",
    "        for title, salary in top_paying.items():\n",
    "            print(f\"   {title[:50]}... ${salary:,.0f}\")\n",
    "    else:\n",
    "        print(\"   (No jobs with >$100K median salary found)\")\n",
    "\n",
    "\n",
    "def _analyze_salary_growth(cross_industry):\n",
    "    \"\"\"Analyze salary growth potential\"\"\"\n",
    "    \n",
    "    print(f\"\\n📈 SALARY GROWTH POTENTIAL ANALYSIS:\")\n",
    "    print(\"=\" * 35)\n",
    "    \n",
    "    salary_data = cross_industry[cross_industry['A_MEDIAN'].notna()]\n",
    "    salary_growth_sample = []\n",
    "    \n",
    "    for occ_code in salary_data['OCC_CODE'].unique()[:20]:  # Sample 20 occupations\n",
    "        occ_salary_data = salary_data[salary_data['OCC_CODE'] == occ_code].sort_values('YEAR')\n",
    "        if len(occ_salary_data) >= 4:  # Need at least 4 years\n",
    "            first_year_salary = occ_salary_data['A_MEDIAN'].iloc[0]\n",
    "            last_year_salary = occ_salary_data['A_MEDIAN'].iloc[-1]\n",
    "            years_span = occ_salary_data['YEAR'].iloc[-1] - occ_salary_data['YEAR'].iloc[0]\n",
    "            \n",
    "            if years_span > 0 and first_year_salary > 0:\n",
    "                annual_growth = ((last_year_salary / first_year_salary) ** (1/years_span) - 1) * 100\n",
    "                salary_growth_sample.append({\n",
    "                    'title': occ_salary_data['OCC_TITLE'].iloc[0],\n",
    "                    'growth': annual_growth,\n",
    "                    'start_salary': first_year_salary,\n",
    "                    'end_salary': last_year_salary\n",
    "                })\n",
    "    \n",
    "    if salary_growth_sample:\n",
    "        salary_growth_sample.sort(key=lambda x: x['growth'], reverse=True)\n",
    "        print(f\"   Sample salary growth rates (annual):\")\n",
    "        for job in salary_growth_sample[:5]:\n",
    "            print(f\"   {job['title'][:45]}... {job['growth']:+.1f}% annual\")\n",
    "\n",
    "\n",
    "def check_specific_popular_careers(df):\n",
    "    \"\"\"Check coverage for specific popular careers students search for\"\"\"\n",
    "    \n",
    "    print(f\"\\n🎯 SPECIFIC POPULAR CAREER COVERAGE:\")\n",
    "    print(\"=\" * 40)\n",
    "    \n",
    "    cross_industry = df[df['NAICS'] == '000000'].copy()\n",
    "    \n",
    "    popular_specific_jobs = [\n",
    "        'Software Developers',\n",
    "        'Registered Nurses', \n",
    "        'Data Scientists',\n",
    "        'Elementary School Teachers',\n",
    "        'Mechanical Engineers',\n",
    "        'Marketing Managers',\n",
    "        'Financial Analysts',\n",
    "        'Graphic Designers',\n",
    "        'Physical Therapists',\n",
    "        'Accountants'\n",
    "    ]\n",
    "    \n",
    "    coverage_results = []\n",
    "    \n",
    "    for job_title in popular_specific_jobs:\n",
    "        job_matches = cross_industry[\n",
    "            cross_industry['OCC_TITLE'].str.contains(job_title, case=False, na=False)\n",
    "        ]\n",
    "        \n",
    "        employment_available = len(job_matches[job_matches['TOT_EMP'].notna()]) > 0\n",
    "        salary_available = len(job_matches[job_matches['A_MEDIAN'].notna()]) > 0\n",
    "        both_available = len(job_matches[\n",
    "            (job_matches['TOT_EMP'].notna()) & \n",
    "            (job_matches['A_MEDIAN'].notna())\n",
    "        ]) > 0\n",
    "        \n",
    "        if len(job_matches) > 0:\n",
    "            sample_salary = job_matches[job_matches['A_MEDIAN'].notna()]['A_MEDIAN'].iloc[0] if salary_available else None\n",
    "            sample_employment = job_matches[job_matches['TOT_EMP'].notna()]['TOT_EMP'].iloc[0] if employment_available else None\n",
    "            \n",
    "            coverage_results.append({\n",
    "                'job': job_title,\n",
    "                'employment': employment_available,\n",
    "                'salary': salary_available,\n",
    "                'complete': both_available,\n",
    "                'sample_salary': sample_salary,\n",
    "                'sample_employment': sample_employment\n",
    "            })\n",
    "            \n",
    "            status_icon = \"🎯\" if both_available else \"📈\" if employment_available else \"❌\"\n",
    "            status_text = \"Complete\" if both_available else \"Employment Only\" if employment_available else \"No Data\"\n",
    "            \n",
    "            print(f\"   {status_icon} {job_title}: {status_text}\")\n",
    "            if sample_employment:\n",
    "                print(f\"      Employment: {sample_employment:,.0f} jobs\")\n",
    "            if sample_salary:\n",
    "                print(f\"      Median Salary: ${sample_salary:,.0f}\")\n",
    "        else:\n",
    "            print(f\"   ❌ {job_title}: Not found in dataset\")\n",
    "    \n",
    "    # Coverage summary\n",
    "    total_checked = len([r for r in coverage_results if r])\n",
    "    complete_available = len([r for r in coverage_results if r and r['complete']])\n",
    "    employment_only = len([r for r in coverage_results if r and r['employment'] and not r['salary']])\n",
    "    \n",
    "    print(f\"\\n📊 Popular Career Summary:\")\n",
    "    print(f\"   🎯 Complete career guidance: {complete_available}/{total_checked} ({complete_available/total_checked*100:.0f}%)\")\n",
    "    print(f\"   📈 Employment forecasts only: {employment_only}/{total_checked} ({employment_only/total_checked*100:.0f}%)\")\n",
    "    \n",
    "    return coverage_results\n",
    "\n",
    "\n",
    "def generate_recommendations(coverage_stats):\n",
    "    \"\"\"Generate recommendations based on coverage analysis\"\"\"\n",
    "    \n",
    "    print(f\"\\n🎯 EXPECTED STUDENT EXPERIENCE:\")\n",
    "    print(\"=\" * 35)\n",
    "    \n",
    "    sal_occs = coverage_stats['total_salary_occupations']\n",
    "    complete_occs = coverage_stats['complete_career_occupations']\n",
    "    coverage_pct = coverage_stats['salary_coverage_percentage']\n",
    "    emp_occs = coverage_stats['employment_eligible']\n",
    "    \n",
    "    print(f\"📈 Jobs with employment forecasts: {emp_occs:,}\")\n",
    "    print(f\"💰 Jobs with salary forecasts: {sal_occs:,}\")\n",
    "    print(f\"🎯 Complete career guidance: {complete_occs:,}\")\n",
    "    print(f\"📊 Salary coverage: {coverage_pct:.1f}% of employment forecasts\")\n",
    "    \n",
    "    print(f\"\\n✅ STUDENT SEARCH RESULTS:\")\n",
    "    if coverage_pct > 80:\n",
    "        print(\"🏆 EXCELLENT - Most job searches will have salary forecasts\")\n",
    "        recommendation = \"✅ Proceed with salary forecasting - excellent coverage expected\"\n",
    "    elif coverage_pct > 60:\n",
    "        print(\"✅ GOOD - Majority of job searches will have salary forecasts\")\n",
    "        recommendation = \"✅ Proceed with salary forecasting - good coverage expected\"\n",
    "    elif coverage_pct > 40:\n",
    "        print(\"🟨 MODERATE - Many job searches will have salary forecasts\")\n",
    "        recommendation = \"🟨 Consider proceeding - moderate coverage available\"\n",
    "    else:\n",
    "        print(\"🔴 LIMITED - Some job searches will have salary forecasts\")\n",
    "        recommendation = \"🔍 Review data quality - may need additional data sources\"\n",
    "    \n",
    "    print(f\"\\n🎓 For Students:\")\n",
    "    print(f\"   • Search popular jobs → {coverage_pct:.0f}% chance of complete forecast\")\n",
    "    print(f\"   • {complete_occs:,} careers with both employment + salary data\")\n",
    "    print(f\"   • Professional-grade career guidance available\")\n",
    "    \n",
    "    print(f\"\\n🚀 RECOMMENDATION:\")\n",
    "    print(f\"   {recommendation}\")\n",
    "    \n",
    "    # Next steps\n",
    "    print(f\"\\n📋 NEXT STEPS:\")\n",
    "    if coverage_pct > 60:\n",
    "        print(\"   1. ✅ Run salary forecasting model (30-45 minutes)\")\n",
    "        print(\"   2. 🔗 Integrate employment + salary databases\")\n",
    "        print(\"   3. 🌐 Deploy complete career guidance platform\")\n",
    "    else:\n",
    "        print(\"   1. 🔍 Consider data quality improvements\")\n",
    "        print(\"   2. 📊 Run salary forecasting on available data\")\n",
    "        print(\"   3. 🌐 Deploy with employment forecasts + partial salary coverage\")\n",
