    "#!/usr/bin/env python3\n",
    "\"\"\"\n",
    "COMPLETE INTEGRATED CAREER FORECASTING SYSTEM - PHASE 3\n",
    "=======================================================\n",
    "Combines employment and salary forecasting with database integration\n",
    "Produces identical outputs to the original two-cell implementation\n",
    "\"\"\"\n",
    "\n",
    "import pandas as pd\n",
    "import numpy as np\n",
    "import json\n",
    "from datetime import datetime\n",
    "import warnings\n",
    "from typing import Dict, List, Optional\n",
    "import plotly.graph_objects as go\n",
    "from plotly.subplots import make_subplots\n",
    "from sklearn.metrics import mean_absolute_percentage_error, r2_score\n",
    "from statsmodels.tsa.holtwinters import ExponentialSmoothing\n",
    "from statsmodels.tsa.arima.model import ARIMA\n",
    "import re\n",
    "import os\n",
    "\n",
    "warnings.filterwarnings('ignore')\n",
    "\n",
    "\n",
    "class IntegratedCareerForecaster:\n",
    "    \"\"\"Integrated Employment + Salary Forecasting System\"\"\"\n",
    "    \n",
    "    def __init__(self):\n",
    "        self.employment_forecasts = {}\n",
    "        self.salary_forecasts = {}\n",
    "        self.integrated_database = {}\n",
    "        \n",
    "    def load_data(self, filepath: str):\n",
    "        \"\"\"Load the main dataset\"\"\"\n",
    "        print(f\"Loading dataset: {filepath}\")\n",
    "        self.df = pd.read_csv(filepath)\n",
    "        self.df['YEAR'] = pd.to_numeric(self.df['YEAR'])\n",
    "        self.df['TOT_EMP'] = pd.to_numeric(self.df['TOT_EMP'], errors='coerce')\n",
    "        self.df['A_MEDIAN'] = pd.to_numeric(self.df['A_MEDIAN'], errors='coerce')\n",
    "        print(f\"Loaded: {len(self.df):,} rows, {self.df['A_MEDIAN'].notna().sum():,} salary records\")\n",
    "        return self\n",
    "    \n",
    "    def load_existing_employment_forecasts(self, filepath: str):\n",
    "        \"\"\"Load existing employment forecasts\"\"\"\n",
    "        try:\n",
    "            with open(filepath, 'r') as f:\n",
    "                self.employment_forecasts = json.load(f)\n",
    "            print(f\"Loaded {len(self.employment_forecasts):,} employment forecasts\")\n",
    "        except FileNotFoundError:\n",
    "            print(\"Employment forecasts not found - proceeding with salary-only\")\n",
    "            self.employment_forecasts = {}\n",
    "        return self\n",
    "        \n",
    "    def calculate_experience_salary_levels(self, occupation_data: pd.DataFrame, occupation: str) -> Dict:\n",
    "        \"\"\"Calculate salary levels by experience using real percentile data\"\"\"\n",
    "        try:\n",
    "            # First try cross-industry data with better error handling\n",
    "            cross_industry = pd.DataFrame()\n",
    "            \n",
    "            # Try NAICS codes first\n",
    "            if 'NAICS_CODE' in occupation_data.columns:\n",
    "                naics_filter = occupation_data['NAICS_CODE'].astype(str).isin(['000000', '000001'])\n",
    "                cross_industry = occupation_data[naics_filter].copy()\n",
    "            \n",
    "            # Try industry title if available and NAICS didn't work\n",
    "            if len(cross_industry) == 0 and 'INDUSTRY_TITLE' in occupation_data.columns:\n",
    "                industry_col = occupation_data['INDUSTRY_TITLE'].fillna('')\n",
    "                industry_filter = industry_col.str.contains('Cross-industry', case=False, na=False)\n",
    "                cross_industry = occupation_data[industry_filter].copy()\n",
    "            \n",
    "            if len(cross_industry) == 0:\n",
    "                cross_industry = occupation_data.copy()\n",
    "        \n",
    "            if len(cross_industry) == 0:\n",
    "                # Complete fallback if no data\n",
    "                return {\n",
    "                    'entry': {'salary': 40000, 'years': '0-2', 'label': 'Entry Level', 'data_source': 'Estimated'},\n",
    "                    'mid': {'salary': 50000, 'years': '3-7', 'label': 'Mid-Level', 'data_source': 'Estimated'},\n",
    "                    'senior': {'salary': 67500, 'years': '8-15', 'label': 'Senior Level', 'data_source': 'Estimated'},\n",
    "                    'executive': {'salary': 87500, 'years': '15+', 'label': 'Executive Level', 'data_source': 'Estimated'},\n",
    "                    'summary': {'salary_range': '$40,000 - $87,500', 'career_growth_potential': '119%'}\n",
    "                }\n",
    "        \n",
    "            latest_year = cross_industry['YEAR'].max()\n",
    "            latest_data = cross_industry[cross_industry['YEAR'] == latest_year]\n",
    "        \n",
    "            if len(latest_data) == 0:\n",
    "                latest_data = cross_industry.iloc[-1:]\n",
    "        \n",
    "            latest_row = latest_data.iloc[0]\n",
    "        \n",
    "            # Extract salary percentiles with better error handling\n",
    "            salary_25th = latest_row.get('A_PCT25') if pd.notna(latest_row.get('A_PCT25')) else None\n",
    "            salary_median = latest_row.get('A_MEDIAN') if pd.notna(latest_row.get('A_MEDIAN')) else None\n",
    "            salary_75th = latest_row.get('A_PCT75') if pd.notna(latest_row.get('A_PCT75')) else None\n",
    "        \n",
    "            # Ensure we have at least median salary\n",
    "            if salary_median is None:\n",
    "                return {\n",
    "                    'entry': {'salary': 40000, 'years': '0-2', 'label': 'Entry Level', 'data_source': 'Estimated'},\n",
    "                    'mid': {'salary': 50000, 'years': '3-7', 'label': 'Mid-Level', 'data_source': 'Estimated'},\n",
    "                    'senior': {'salary': 67500, 'years': '8-15', 'label': 'Senior Level', 'data_source': 'Estimated'},\n",
    "                    'executive': {'salary': 87500, 'years': '15+', 'label': 'Executive Level', 'data_source': 'Estimated'},\n",
    "                    'summary': {'salary_range': '$40,000 - $87,500', 'career_growth_potential': '119%'}\n",
    "                }\n",
    "        \n",
    "            experience_salaries = {}\n",
    "        \n",
    "            # Entry Level - Use 25th percentile or estimate\n",
    "            entry_salary = salary_25th if salary_25th is not None else salary_median * 0.75\n",
    "            experience_salaries['entry'] = {\n",
    "                'salary': round(entry_salary),\n",
    "                'years': '0-2',\n",
    "                'label': 'Entry Level',\n",
    "                'data_source': 'A_PCT25' if salary_25th is not None else 'Estimated'\n",
    "            }\n",
    "        \n",
    "            # Mid Level - Use median\n",
    "            experience_salaries['mid'] = {\n",
    "                'salary': round(salary_median),\n",
    "                'years': '3-7',\n",
    "                'label': 'Mid-Level',\n",
    "                'data_source': 'A_MEDIAN'\n",
    "            }\n",
    "        \n",
    "            # Senior Level - Use 75th percentile or estimate\n",
    "            senior_salary = salary_75th if salary_75th is not None else salary_median * 1.35\n",
    "            experience_salaries['senior'] = {\n",
    "                'salary': round(senior_salary),\n",
    "                'years': '8-15',\n",
    "                'label': 'Senior Level',\n",
    "                'data_source': 'A_PCT75' if salary_75th is not None else 'Estimated'\n",
    "            }\n",
    "        \n",
    "            # Executive Level - Extrapolate\n",
    "            if salary_75th is not None and salary_median is not None:\n",
    "                percentile_gap = salary_75th - salary_median\n",
    "                executive_salary = salary_median + (percentile_gap * 2.5)\n",
    "            else:\n",
    "                executive_salary = salary_median * 1.75\n",
    "            \n",
    "            experience_salaries['executive'] = {\n",
    "                'salary': round(executive_salary),\n",
    "                'years': '15+',\n",
    "                'label': 'Executive Level',\n",
    "                'data_source': 'Extrapolated' if salary_75th is not None else 'Estimated'\n",
    "            }\n",
    "        \n",
    "            all_salaries = [exp['salary'] for exp in experience_salaries.values()]\n",
    "            experience_salaries['summary'] = {\n",
    "                'salary_range': f\"${min(all_salaries):,} - ${max(all_salaries):,}\",\n",
    "                'career_growth_potential': f\"{((max(all_salaries) / min(all_salaries)) - 1) * 100:.0f}%\"\n",
    "            }\n",
    "        \n",
    "            return experience_salaries\n",
    "            \n",
    "        except Exception as e:\n",
    "            # Ultimate fallback\n",
    "            print(f\"Error in experience calculation: {e}\")\n",
    "            return {\n",
    "                'entry': {'salary': 40000, 'years': '0-2', 'label': 'Entry Level', 'data_source': 'Estimated'},\n",
    "                'mid': {'salary': 50000, 'years': '3-7', 'label': 'Mid-Level', 'data_source': 'Estimated'},\n",
    "                'senior': {'salary': 67500, 'years': '8-15', 'label': 'Senior Level', 'data_source': 'Estimated'},\n",
    "                'executive': {'salary': 87500, 'years': '15+', 'label': 'Executive Level', 'data_source': 'Estimated'},\n",
    "                'summary': {'salary_range': '$40,000 - $87,500', 'career_growth_potential': '119%'}\n",
    "            }\n",
    "    \n",
    "    def forecast_salary_with_methods(self, salary_data: pd.Series, years: List[int]) -> Dict:\n",
    "        \"\"\"Multi-method salary forecasting with R² and MAPE\"\"\"\n",
    "        methods_results = {}\n",
    "        forecast_years = list(range(2024, 2031))\n",
    "        \n",
    "        # Method 1: Random Walk with Drift\n",
    "        try:\n",
    "            diff = salary_data.diff().dropna()\n",
    "            drift = max(diff.mean(), salary_data.iloc[-1] * 0.02)\n",
    "            \n",
    "            forecasts = []\n",
    "            last_value = salary_data.iloc[-1]\n",
    "            for _ in forecast_years:\n",
    "                last_value += drift\n",
    "                forecasts.append(last_value)\n",
    "            \n",
    "            train_pred = [salary_data.iloc[i-1] + drift for i in range(1, len(salary_data))]\n",
    "            if len(train_pred) > 0:\n",
    "                mape = mean_absolute_percentage_error(salary_data.iloc[1:], train_pred) * 100\n",
    "                r2 = r2_score(salary_data.iloc[1:], train_pred)\n",
    "            else:\n",
    "                mape, r2 = 15, 0.3\n",
    "                \n",
    "            methods_results['random_walk'] = {\n",
    "                'forecasts': forecasts, 'mape': mape, 'r2': r2,\n",
    "                'weight': 0.4 if mape < 15 else 0.2\n",
    "            }\n",
    "        except:\n",
    "            methods_results['random_walk'] = {\n",
    "                'forecasts': [salary_data.iloc[-1] * (1.03 ** (i+1)) for i in range(7)],\n",
    "                'mape': 15, 'r2': 0.3, 'weight': 0.3\n",
    "            }\n",
    "        \n",
    "        # Method 2: Exponential Smoothing\n",
    "        try:\n",
    "            if len(salary_data) >= 4:\n",
    "                model = ExponentialSmoothing(salary_data, trend='add')\n",
    "                fitted_model = model.fit()\n",
    "                forecasts = fitted_model.forecast(steps=7).tolist()\n",
    "                mape = mean_absolute_percentage_error(salary_data, fitted_model.fittedvalues) * 100\n",
    "                r2 = r2_score(salary_data, fitted_model.fittedvalues)\n",
    "            else:\n",
    "                trend = (salary_data.iloc[-1] - salary_data.iloc[0]) / len(salary_data)\n",
    "                forecasts = [salary_data.iloc[-1] + trend * (i+1) for i in range(7)]\n",
    "                mape, r2 = 12, 0.4\n",
    "                \n",
    "            methods_results['exp_smoothing'] = {\n",
    "                'forecasts': forecasts, 'mape': mape, 'r2': r2,\n",
    "                'weight': 0.3 if mape < 20 else 0.2\n",
    "            }\n",
    "        except:\n",
    "            trend = (salary_data.iloc[-1] - salary_data.iloc[0]) / len(salary_data)\n",
    "            forecasts = [salary_data.iloc[-1] + trend * (i+1) for i in range(7)]\n",
    "            methods_results['exp_smoothing'] = {'forecasts': forecasts, 'mape': 12, 'r2': 0.4, 'weight': 0.2}\n",
    "        \n",
    "        # Method 3: ARIMA\n",
    "        try:\n",
    "            if len(salary_data) >= 5:\n",
    "                model = ARIMA(salary_data, order=(1, 1, 1))\n",
    "                fitted_model = model.fit()\n",
    "                forecasts = fitted_model.forecast(steps=7).tolist()\n",
    "                mape = mean_absolute_percentage_error(salary_data.iloc[1:], fitted_model.fittedvalues[1:]) * 100\n",
    "                r2 = r2_score(salary_data.iloc[1:], fitted_model.fittedvalues[1:])\n",
    "                methods_results['arima'] = {'forecasts': forecasts, 'mape': mape, 'r2': r2, 'weight': 0.3}\n",
    "            else:\n",
    "                raise ValueError(\"Insufficient data\")\n",
    "        except:\n",
    "            slope = (salary_data.iloc[-1] - salary_data.iloc[0]) / len(salary_data)\n",
    "            forecasts = [salary_data.iloc[-1] + slope * (i+1) for i in range(7)]\n",
    "            methods_results['arima'] = {'forecasts': forecasts, 'mape': 18, 'r2': 0.2, 'weight': 0.1}\n",
    "        \n",
    "        return methods_results\n",
    "    \n",
    "    def create_ensemble_salary_forecast(self, methods_results: Dict) -> Dict:\n",
    "        \"\"\"Create weighted ensemble with quality assessment\"\"\"\n",
    "        total_weight = sum(method['weight'] for method in methods_results.values()) or 1\n",
    "        \n",
    "        ensemble_forecasts = []\n",
    "        for i in range(7):\n",
    "            weighted_sum = sum(method['forecasts'][i] * method['weight'] for method in methods_results.values())\n",
    "            ensemble_forecasts.append(weighted_sum / total_weight)\n",
    "        \n",
    "        mapes = [method['mape'] for method in methods_results.values()]\n",
    "        r2s = [method['r2'] for method in methods_results.values() if method['r2'] > -10]\n",
    "        \n",
    "        ensemble_mape = np.average(mapes, weights=[method['weight'] for method in methods_results.values()])\n",
    "        ensemble_r2 = np.mean(r2s) if r2s else 0.3\n",
    "        \n",
    "        if ensemble_mape <= 8 and ensemble_r2 >= 0.7:\n",
    "            quality = \"EXCELLENT\"\n",
    "        elif ensemble_mape <= 15 and ensemble_r2 >= 0.5:\n",
    "            quality = \"GOOD\"\n",
    "        elif ensemble_mape <= 25:\n",
    "            quality = \"FAIR\"\n",
    "        else:\n",
    "            quality = \"POOR\"\n",
    "        \n",
    "        return {\n",
    "            'forecasts': ensemble_forecasts, 'mape': ensemble_mape, 'r2': ensemble_r2,\n",
    "            'quality': quality, 'methods_used': list(methods_results.keys())\n",
    "        }\n",
    "    \n",
    "    def process_single_occupation_salary(self, occupation_data: pd.DataFrame, occupation: str) -> Optional[Dict]:\n",
    "        \"\"\"Process salary forecasting for single occupation\"\"\"\n",
    "        \n",
    "        # Debug: Check what data we have\n",
    "        print(f\"\\nDEBUG: Processing {occupation}\")\n",
    "        print(f\"  Total records: {len(occupation_data)}\")\n",
    "        print(f\"  Years available: {sorted(occupation_data['YEAR'].unique())}\")\n",
    "        \n",
    "        # Check available columns\n",
    "        available_columns = occupation_data.columns.tolist()\n",
    "        print(f\"  Available columns: {available_columns}\")\n",
    "        \n",
    "        try:\n",
    "            # First try cross-industry data with better error handling\n",
    "            cross_industry = pd.DataFrame()\n",
    "            \n",
    "            # Try NAICS codes first\n",
    "            if 'NAICS_CODE' in occupation_data.columns:\n",
    "                naics_filter = occupation_data['NAICS_CODE'].astype(str).isin(['000000', '000001'])\n",
    "                cross_industry = occupation_data[naics_filter].copy()\n",
    "                print(f\"  NAICS cross-industry records: {len(cross_industry)}\")\n",
    "            \n",
    "            # Try industry title if available and NAICS didn't work\n",
    "            if len(cross_industry) == 0 and 'INDUSTRY_TITLE' in occupation_data.columns:\n",
    "                industry_col = occupation_data['INDUSTRY_TITLE'].fillna('')\n",
    "                industry_filter = industry_col.str.contains('Cross-industry', case=False, na=False)\n",
    "                cross_industry = occupation_data[industry_filter].copy()\n",
    "                print(f\"  Industry title cross-industry records: {len(cross_industry)}\")\n",
    "            \n",
    "            # If no cross-industry data, use all available data\n",
    "            if len(cross_industry) == 0:\n",
    "                cross_industry = occupation_data.copy()\n",
    "                print(f\"  Using all data: {len(cross_industry)} records\")\n",
    "            \n",
    "            if len(cross_industry) < 3:\n",
    "                print(f\"  SKIP: Insufficient records ({len(cross_industry)} < 3)\")\n",
    "                return None\n",
    "            \n",
    "            # Get salary data by year, handling multiple entries per year\n",
    "            salary_by_year = cross_industry.groupby('YEAR')['A_MEDIAN'].first().sort_index()\n",
    "            salary_series = salary_by_year.dropna()\n",
    "            \n",
    "            print(f\"  Salary data points: {len(salary_series)}\")\n",
    "            if len(salary_series) > 0:\n",
    "                print(f\"  Salary range: ${salary_series.min():,.0f} - ${salary_series.max():,.0f}\")\n",
    "            \n",
    "            if len(salary_series) < 3:\n",
    "                print(f\"  SKIP: Insufficient salary data ({len(salary_series)} < 3)\")\n",
    "                return None\n",
    "            \n",
    "            years = salary_series.index.tolist()\n",
    "            current_salary = salary_series.iloc[-1]\n",
    "            \n",
    "            print(f\"  Processing with {len(salary_series)} years, current: ${current_salary:,.0f}\")\n",
    "            \n",
    "            methods_results = self.forecast_salary_with_methods(salary_series, years)\n",
    "            ensemble_result = self.create_ensemble_salary_forecast(methods_results)\n",
    "            \n",
    "            historical_growth = ((salary_series.iloc[-1] / salary_series.iloc[0]) ** (1/(len(salary_series)-1)) - 1) * 100\n",
    "            forecast_growth = ((ensemble_result['forecasts'][-1] / current_salary) ** (1/7) - 1) * 100\n",
    "            \n",
    "            experience_breakdown = self.calculate_experience_salary_levels(cross_industry, occupation)\n",
    "            \n",
    "            vs_national = ((current_salary / 50000) - 1) * 100\n",
    "            \n",
    "            result = {\n",
    "                'occupation': occupation,\n",
    "                'current_year': max(years),\n",
    "                'historical_data': {\n",
    "                    'years': years,\n",
    "                    'salaries': salary_series.tolist(),\n",
    "                    'data_points': len(salary_series)\n",
    "                },\n",
    "                'current_metrics': {\n",
    "                    'median_salary': round(current_salary),\n",
    "                    'vs_national_average': f\"{vs_national:+.1f}%\",\n",
    "                    'historical_growth_rate': f\"{historical_growth:.1f}%\"\n",
    "                },\n",
    "                'forecasts': {\n",
    "                    'years': list(range(2024, 2031)),\n",
    "                    'predicted_salaries': [round(x) for x in ensemble_result['forecasts']],\n",
    "                    'forecast_growth_rate': f\"{forecast_growth:.1f}%\",\n",
    "                    'salary_2030': round(ensemble_result['forecasts'][-1])\n",
    "                },\n",
    "                'experience_levels': {\n",
    "                    'current': experience_breakdown\n",
    "                },\n",
    "                'model_quality': {\n",
    "                    'mape': round(ensemble_result['mape'], 1),\n",
    "                    'r_squared': round(ensemble_result['r2'], 3),\n",
    "                    'quality_rating': ensemble_result['quality'],\n",
    "                    'methods_used': ensemble_result['methods_used']\n",
    "                },\n",
    "                'student_guidance': self.generate_student_guidance(current_salary, forecast_growth, vs_national, ensemble_result['quality'])\n",
    "            }\n",
    "            \n",
    "            print(f\"  SUCCESS: {ensemble_result['quality']} quality, MAPE: {ensemble_result['mape']:.1f}%\")\n",
    "            return result\n",
    "            \n",
    "        except Exception as e:\n",
    "            print(f\"  ERROR: {e}\")\n",
    "            return None\n",
    "    \n",
    "    def generate_student_guidance(self, salary: float, growth_rate: float, vs_national: float, quality: str) -> Dict:\n",
    "        \"\"\"Generate student-friendly career guidance\"\"\"\n",
    "        if salary >= 100000:\n",
    "            tier = \"💰 High-Paying\"\n",
    "        elif salary >= 70000:\n",
    "            tier = \"💼 Well-Paying\"\n",
    "        elif salary >= 50000:\n",
    "            tier = \"📊 Moderate\"\n",
    "        else:\n",
    "            tier = \"🌱 Entry-Level\"\n",
    "        \n",
    "        if growth_rate >= 4:\n",
    "            growth_potential = \"🚀 Excellent\"\n",
    "        elif growth_rate >= 2:\n",
    "            growth_potential = \"📈 Good\"\n",
    "        elif growth_rate >= 0:\n",
    "            growth_potential = \"🔄 Stable\"\n",
    "        else:\n",
    "            growth_potential = \"📉 Declining\"\n",
    "        \n",
    "        score = 0\n",
    "        if salary >= 70000: score += 3\n",
    "        elif salary >= 50000: score += 2\n",
    "        elif salary >= 40000: score += 1\n",
    "        \n",
    "        if growth_rate >= 3: score += 3\n",
    "        elif growth_rate >= 1: score += 2\n",
    "        elif growth_rate >= 0: score += 1\n",
    "        \n",
    "        if vs_national >= 20: score += 2\n",
    "        elif vs_national >= 0: score += 1\n",
    "        \n",
    "        if score >= 7:\n",
    "            recommendation = \"🌟 EXCELLENT FINANCIAL PROSPECTS\"\n",
    "        elif score >= 5:\n",
    "            recommendation = \"✅ STRONG FINANCIAL PROSPECTS\"\n",
    "        elif score >= 3:\n",
    "            recommendation = \"🟨 MODERATE FINANCIAL PROSPECTS\"\n",
    "        else:\n",
    "            recommendation = \"⚠️ LIMITED FINANCIAL PROSPECTS\"\n",
    "        \n",
    "        return {\n",
    "            'salary_tier': tier,\n",
    "            'growth_potential': growth_potential,\n",
    "            'overall_recommendation': recommendation,\n",
    "            'key_points': [\n",
    "                f\"Starting salary around ${salary:,.0f}\",\n",
    "                f\"Expected {growth_rate:.1f}% annual growth\",\n",
    "                f\"{vs_national:+.1f}% vs national average\",\n",
    "                f\"Forecast reliability: {quality}\"\n",
    "            ]\n",
    "        }\n",
    "    \n",
    "    def build_complete_salary_database(self) -> Dict:\n",
    "        \"\"\"Build complete salary database\"\"\"\n",
    "        print(\"\\nBuilding complete career database...\")\n",
    "        \n",
    "        # Check what employment forecasts we have\n",
    "        print(f\"Employment forecasts available: {len(self.employment_forecasts)}\")\n",
    "        if len(self.employment_forecasts) > 0:\n",
    "            sample_emp_job = list(self.employment_forecasts.keys())[0]\n",
    "            print(f\"Sample employment job: {sample_emp_job}\")\n",
    "        \n",
    "        occupation_groups = self.df.groupby('OCC_TITLE')\n",
    "        eligible_occupations = []\n",
    "        \n",
    "        for occ_title, group in occupation_groups:\n",
    "            salary_data = group['A_MEDIAN'].dropna()\n",
    "            if len(salary_data) >= 3:\n",
    "                eligible_occupations.append(occ_title)\n",
    "        \n",
    "        print(f\"Processing {len(eligible_occupations):,} occupations for salary forecasting...\")\n",
    "        start_time = datetime.now()\n",
    "        \n",
    "        successful_forecasts = 0\n",
    "        \n",
    "        for i, occupation in enumerate(eligible_occupations):\n",
    "            try:\n",
    "                occupation_data = occupation_groups.get_group(occupation)\n",
    "                salary_result = self.process_single_occupation_salary(occupation_data, occupation)\n",
    "                \n",
    "                if salary_result:\n",
    "                    self.salary_forecasts[occupation] = salary_result\n",
    "                    successful_forecasts += 1\n",
    "                \n",
    "                if (i + 1) % 100 == 0:\n",
    "                    elapsed = (datetime.now() - start_time).total_seconds() / 60\n",
    "                    print(f\"Progress: {i+1}/{len(eligible_occupations)} ({(i+1)/len(eligible_occupations)*100:.1f}%) | \"\n",
    "                          f\"Success: {successful_forecasts} | Time: {elapsed:.1f}min\")\n",
    "                    \n",
    "                    if (i + 1) % 200 == 0 and successful_forecasts > 0:\n",
    "                        self.display_metrics()\n",
    "                \n",
    "            except Exception as e:\n",
    "                if i < 5:  # Show first few errors for debugging\n",
    "                    print(f\"Error processing {occupation}: {e}\")\n",
    "                continue\n",
    "        \n",
    "        print(f\"\\nSalary forecasting complete: {successful_forecasts} successful\")\n",
    "        \n",
    "        # Integration with employment forecasts\n",
    "        print(\"Integrating with employment forecasts...\")\n",
    "        \n",
    "        # Create a mapping for better matching\n",
    "        employment_jobs = set(self.employment_forecasts.keys())\n",
    "        salary_jobs = set(self.salary_forecasts.keys())\n",
    "        \n",
    "        print(f\"Employment jobs: {len(employment_jobs)}\")\n",
    "        print(f\"Salary jobs: {len(salary_jobs)}\")\n",
    "        \n",
    "        # Find overlapping jobs\n",
    "        overlapping = employment_jobs & salary_jobs\n",
    "        print(f\"Direct matches: {len(overlapping)}\")\n",
    "        \n",
    "        # If few direct matches, try fuzzy matching\n",
    "        if len(overlapping) < 10 and len(employment_jobs) > 0 and len(salary_jobs) > 0:\n",
    "            print(\"Attempting fuzzy matching...\")\n",
    "            # Sample a few for debugging\n",
    "            sample_emp = list(employment_jobs)[:3]\n",
    "            sample_sal = list(salary_jobs)[:3]\n",
    "            print(f\"Sample employment jobs: {sample_emp}\")\n",
    "            print(f\"Sample salary jobs: {sample_sal}\")\n",
    "        \n",
    "        all_occupations = employment_jobs | salary_jobs\n",
    "        \n",
    "        for occupation in all_occupations:\n",
    "            employment_data = self.employment_forecasts.get(occupation)\n",
    "            salary_data = self.salary_forecasts.get(occupation)\n",
    "            \n",
    "            integrated_career = {\n",
    "                'occupation': occupation,\n",
    "                'has_employment_forecast': employment_data is not None,\n",
    "                'has_salary_forecast': salary_data is not None,\n",
    "                'last_updated': datetime.now().isoformat()\n",
    "            }\n",
    "            \n",
    "            if employment_data:\n",
    "                integrated_career['employment'] = employment_data\n",
    "            \n",
    "            if salary_data:\n",
    "                integrated_career['salary'] = salary_data\n",
    "                \n",
    "            # Add complete career analysis if both available\n",
    "            if employment_data and salary_data:\n",
    "                integrated_career['complete_career_analysis'] = {\n",
    "                    'overall_recommendation': '🌟 COMPLETE CAREER DATA AVAILABLE',\n",
    "                    'employment_outlook': employment_data.get('student_recommendation', 'Available'),\n",
    "                    'salary_outlook': salary_data['student_guidance']['overall_recommendation']\n",
    "                }\n",
    "            \n",
    "            self.integrated_database[occupation] = integrated_career\n",
    "        \n",
    "        print(f\"Integrated database created: {len(self.integrated_database)} total jobs\")\n",
    "        \n",
    "        if successful_forecasts > 0:\n",
    "            print(\"Generating charts...\")\n",
    "            self.generate_charts()\n",
    "        else:\n",
    "            print(\"Skipping chart generation - no salary forecasts to chart\")\n",
    "        \n",
    "        return self.integrated_database\n",
    "    \n",
    "    def display_metrics(self):\n",
    "        \"\"\"Display real-time metrics\"\"\"\n",
    "        processed_jobs = [job for job in self.integrated_database.values() if job['has_salary_forecast']]\n",
    "        \n",
    "        if len(processed_jobs) == 0:\n",
    "            return\n",
    "        \n",
    "        mapes = []\n",
    "        r2s = []\n",
    "        quality_counts = {'EXCELLENT': 0, 'GOOD': 0, 'FAIR': 0, 'POOR': 0}\n",
    "        \n",
    "        for job in processed_jobs:\n",
    "            salary_data = job['salary']\n",
    "            mapes.append(salary_data['model_quality']['mape'])\n",
    "            r2s.append(salary_data['model_quality']['r_squared'])\n",
    "            quality_counts[salary_data['model_quality']['quality_rating']] += 1\n",
    "        \n",
    "        print(f\"\\nMetrics Update - Jobs: {len(processed_jobs):,}\")\n",
    "        print(f\"Average MAPE: {np.mean(mapes):.1f}% | Average R²: {np.mean(r2s):.3f}\")\n",
    "        print(f\"Quality: EXCELLENT {quality_counts['EXCELLENT']} | GOOD {quality_counts['GOOD']} | \"\n",
    "              f\"FAIR {quality_counts['FAIR']} | POOR {quality_counts['POOR']}\")\n",
    "    \n",
    "    def generate_charts(self):\n",
    "        \"\"\"Generate essential charts\"\"\"\n",
    "        os.makedirs('salary_charts', exist_ok=True)\n",
    "        os.makedirs('salary_charts/individual', exist_ok=True)\n",
    "        \n",
    "        charts_generated = 0\n",
    "        \n",
    "        for occupation, data in self.integrated_database.items():\n",
    "            if data['has_salary_forecast']:\n",
    "                try:\n",
    "                    safe_filename = re.sub(r'[^\\w\\s-]', '', occupation)[:50].replace(' ', '_')\n",
    "                    chart_path = f'salary_charts/individual/{safe_filename}_analysis.html'\n",
    "                    \n",
    "                    self.generate_individual_chart(data, chart_path)\n",
    "                    charts_generated += 1\n",
    "                    \n",
    "                    if charts_generated % 50 == 0:\n",
    "                        print(f\"Generated {charts_generated} charts...\")\n",
    "                        \n",
    "                except Exception as e:\n",
    "                    continue\n",
    "        \n",
    "        print(f\"Generated {charts_generated} salary charts\")\n",
    "    \n",
    "    def generate_individual_chart(self, occupation_data: Dict, save_path: str):\n",
    "        \"\"\"Generate individual job chart\"\"\"\n",
    "        occupation = occupation_data['occupation']\n",
    "        salary_data = occupation_data['salary']\n",
    "        \n",
    "        fig = make_subplots(\n",
    "            rows=2, cols=2,\n",
    "            subplot_titles=('Salary Over Time', 'Experience Levels', 'Career Progression', 'Metrics'),\n",
    "            specs=[[{}, {\"type\": \"bar\"}], [{\"colspan\": 2}, None]]\n",
    "        )\n",
    "        \n",
    "        # Historical and forecast data\n",
    "        hist_years = salary_data['historical_data']['years']\n",
    "        hist_salaries = salary_data['historical_data']['salaries']\n",
    "        forecast_years = salary_data['forecasts']['years']\n",
    "        forecast_salaries = salary_data['forecasts']['predicted_salaries']\n",
    "        \n",
    "        fig.add_trace(go.Scatter(x=hist_years, y=hist_salaries, mode='lines+markers', \n",
    "                                name='Historical', line=dict(color='blue', width=3)), row=1, col=1)\n",
    "        fig.add_trace(go.Scatter(x=forecast_years, y=forecast_salaries, mode='lines+markers',\n",
    "                                name='Forecast', line=dict(color='red', width=3, dash='dash')), row=1, col=1)\n",
    "        \n",
    "        # Experience levels\n",
    "        exp_data = salary_data['experience_levels']['current']\n",
    "        levels = ['entry', 'mid', 'senior', 'executive']\n",
    "        level_labels = [exp_data[level]['label'] for level in levels]\n",
    "        level_salaries = [exp_data[level]['salary'] for level in levels]\n",
    "        \n",
    "        fig.add_trace(go.Bar(x=level_labels, y=level_salaries, name='Experience Levels',\n",
    "                            marker_color='green'), row=1, col=2)\n",
    "        \n",
    "        # Career progression timeline\n",
    "        career_years = list(range(0, 21))\n",
    "        career_salaries = []\n",
    "        for year in career_years:\n",
    "            if year <= 2:\n",
    "                salary = exp_data['entry']['salary']\n",
    "            elif year <= 7:\n",
    "                progress = (year - 2) / 5\n",
    "                salary = exp_data['entry']['salary'] + progress * (exp_data['mid']['salary'] - exp_data['entry']['salary'])\n",
    "            elif year <= 15:\n",
    "                progress = (year - 7) / 8\n",
    "                salary = exp_data['mid']['salary'] + progress * (exp_data['senior']['salary'] - exp_data['mid']['salary'])\n",
    "            else:\n",
    "                progress = min((year - 15) / 5, 1)\n",
    "                salary = exp_data['senior']['salary'] + progress * (exp_data['executive']['salary'] - exp_data['senior']['salary'])\n",
    "            career_salaries.append(salary)\n",
    "        \n",
    "        fig.add_trace(go.Scatter(x=career_years, y=career_salaries, mode='lines+markers',\n",
    "                                name='Career Path', line=dict(color='orange', width=4)), row=2, col=1)\n",
    "        \n",
    "        # Update layout\n",
    "        mape = salary_data['model_quality']['mape']\n",
    "        r2 = salary_data['model_quality']['r_squared']\n",
    "        quality = salary_data['model_quality']['quality_rating']\n",
    "        \n",
    "        fig.update_layout(\n",
    "            title=f'{occupation}<br>MAPE: {mape:.1f}% | R²: {r2:.3f} | Quality: {quality}',\n",
    "            height=800, showlegend=True, template='plotly_white'\n",
    "        )\n",
    "        \n",
    "        fig.update_yaxes(tickformat='$,.0f')\n",
    "        fig.write_html(save_path)\n",
    "\n",
    "\n",
    "class CareerDatabaseIntegrator:\n",
    "    \"\"\"Career Database Integration System - Fixes key mismatch\"\"\"\n",
    "    \n",
    "    def __init__(self):\n",
    "        self.employment_data = {}\n",
    "        self.salary_data = {}\n",
    "        self.integrated_database = {}\n",
    "        self.key_mapping = {}\n",
    "        \n",
    "    def load_employment_forecasts(self, filepath: str = 'complete_employment_forecasts.json'):\n",
    "        \"\"\"Load employment forecasts (keyed by OCC_CODE)\"\"\"\n",
    "        try:\n",
    "            with open(filepath, 'r') as f:\n",
    "                data = json.load(f)\n",
    "            \n",
    "            # Extract the occupations data\n",
    "            if 'occupations' in data:\n",
    "                self.employment_data = data['occupations']\n",
    "            else:\n",
    "                self.employment_data = data\n",
    "                \n",
    "            print(f\"✅ Employment forecasts loaded: {len(self.employment_data):,} jobs\")\n",
    "            \n",
    "            # Show sample employment keys\n",
    "            sample_keys = list(self.employment_data.keys())[:3]\n",
    "            print(f\"   Sample employment keys: {sample_keys}\")\n",
    "            \n",
    "            return True\n",
    "            \n",
    "        except FileNotFoundError:\n",
    "            print(f\"❌ Employment file not found: {filepath}\")\n",
    "            return False\n",
    "        except Exception as e:\n",
    "            print(f\"❌ Error loading employment data: {e}\")\n",
    "            return False\n",
    "    \n",
    "    def load_salary_forecasts(self, filepath: str = 'complete_integrated_career_database.json'):\n",
    "        \"\"\"Load salary forecasts (keyed by OCC_TITLE)\"\"\"\n",
    "        try:\n",
    "            with open(filepath, 'r') as f:\n",
    "                data = json.load(f)\n",
    "            \n",
    "            # Extract salary-only forecasts\n",
    "            salary_only = {}\n",
    "            for key, job_data in data.items():\n",
    "                if job_data.get('has_salary_forecast', False):\n",
    "                    salary_only[key] = job_data['salary']\n",
    "            \n",
    "            self.salary_data = salary_only\n",
    "            print(f\"✅ Salary forecasts loaded: {len(self.salary_data):,} jobs\")\n",
    "            \n",
    "            # Show sample salary keys\n",
    "            sample_keys = list(self.salary_data.keys())[:3]\n",
    "            print(f\"   Sample salary keys: {sample_keys}\")\n",
    "            \n",
    "            return True\n",
    "            \n",
    "        except FileNotFoundError:\n",
    "            print(f\"❌ Salary file not found: {filepath}\")\n",
    "            return False\n",
    "        except Exception as e:\n",
    "            print(f\"❌ Error loading salary data: {e}\")\n",
    "            return False\n",
    "    \n",
    "    def create_key_mapping(self, dataset_path: str = 'complete_forecasting_dataset.csv'):\n",
    "        \"\"\"Create mapping between OCC_CODE and OCC_TITLE\"\"\"\n",
    "        try:\n",
    "            print(\"🔗 Creating key mapping between employment and salary data...\")\n",
    "            \n",
    "            # Load the original dataset to get the mapping\n",
    "            df = pd.read_csv(dataset_path)\n",
    "            \n",
    "            # Get unique OCC_CODE to OCC_TITLE mapping\n",
    "            mapping_df = df[['OCC_CODE', 'OCC_TITLE']].drop_duplicates()\n",
    "            \n",
    "            # Create both directions of mapping\n",
    "            code_to_title = {}\n",
    "            title_to_code = {}\n",
    "            \n",
    "            for _, row in mapping_df.iterrows():\n",
    "                occ_code = row['OCC_CODE']\n",
    "                occ_title = row['OCC_TITLE']\n",
    "                \n",
    "                code_to_title[occ_code] = occ_title\n",
    "                title_to_code[occ_title] = occ_code\n",
    "            \n",
    "            self.key_mapping = {\n",
    "                'code_to_title': code_to_title,\n",
    "                'title_to_code': title_to_code\n",
    "            }\n",
    "            \n",
    "            print(f\"✅ Key mapping created: {len(code_to_title):,} occupation codes mapped\")\n",
    "            \n",
    "            # Test mapping with sample data\n",
    "            print(\"\\n🔍 Testing key mapping:\")\n",
    "            sample_emp_codes = list(self.employment_data.keys())[:3]\n",
    "            sample_sal_titles = list(self.salary_data.keys())[:3]\n",
    "            \n",
    "            print(\"Employment to Salary mapping:\")\n",
    "            for code in sample_emp_codes:\n",
    "                if code in code_to_title:\n",
    "                    title = code_to_title[code]\n",
    "                    has_salary = title in self.salary_data\n",
    "                    print(f\"   {code} → {title[:50]}... (Salary: {'✅' if has_salary else '❌'})\")\n",
    "                else:\n",
    "                    print(f\"   {code} → No mapping found\")\n",
    "            \n",
    "            print(\"\\nSalary to Employment mapping:\")\n",
    "            for title in sample_sal_titles:\n",
    "                if title in title_to_code:\n",
    "                    code = title_to_code[title]\n",
    "                    has_employment = code in self.employment_data\n",
    "                    print(f\"   {title[:50]}... → {code} (Employment: {'✅' if has_employment else '❌'})\")\n",
    "                else:\n",
    "                    print(f\"   {title[:50]}... → No mapping found\")\n",
    "            \n",
    "            return True\n",
    "            \n",
    "        except Exception as e:\n",
    "            print(f\"❌ Error creating key mapping: {e}\")\n",
    "            return False\n",
    "    \n",
    "    def find_matches(self):\n",
    "        \"\"\"Find matches between employment and salary data\"\"\"\n",
    "        print(\"\\n🎯 Finding matches between employment and salary forecasts...\")\n",
    "        \n",
    "        code_to_title = self.key_mapping['code_to_title']\n",
    "        title_to_code = self.key_mapping['title_to_code']\n",
    "        \n",
    "        # Find direct matches via mapping\n",
    "        direct_matches = []\n",
    "        employment_only = []\n",
    "        salary_only = []\n",
    "        \n",
    "        # Check employment data for matches\n",
    "        for emp_code, emp_data in self.employment_data.items():\n",
    "            if emp_code in code_to_title:\n",
    "                occ_title = code_to_title[emp_code]\n",
    "                if occ_title in self.salary_data:\n",
    "                    direct_matches.append({\n",
    "                        'occ_code': emp_code,\n",
    "                        'occ_title': occ_title,\n",
    "                        'employment_data': emp_data,\n",
    "                        'salary_data': self.salary_data[occ_title]\n",
    "                    })\n",
    "                else:\n",
    "                    employment_only.append({\n",
    "                        'occ_code': emp_code,\n",
    "                        'occ_title': occ_title,\n",
    "                        'employment_data': emp_data\n",
    "                    })\n",
    "        \n",
    "        # Check salary data for unmatched entries\n",
    "        for sal_title, sal_data in self.salary_data.items():\n",
    "            if sal_title in title_to_code:\n",
    "                occ_code = title_to_code[sal_title]\n",
    "                if occ_code not in self.employment_data:\n",
    "                    salary_only.append({\n",
    "                        'occ_code': occ_code,\n",
    "                        'occ_title': sal_title,\n",
    "                        'salary_data': sal_data\n",
    "                    })\n",
    "            else:\n",
    "                # No mapping found - salary data without corresponding employment\n",
    "                salary_only.append({\n",
    "                    'occ_code': None,\n",
    "                    'occ_title': sal_title,\n",
    "                    'salary_data': sal_data\n",
    "                })\n",
    "        \n",
    "        print(f\"📊 Match Results:\")\n",
    "        print(f\"   🎯 Complete matches (both employment + salary): {len(direct_matches):,}\")\n",
    "        print(f\"   📈 Employment only: {len(employment_only):,}\")\n",
    "        print(f\"   💰 Salary only: {len(salary_only):,}\")\n",
    "        \n",
    "        match_rate = len(direct_matches) / max(len(self.employment_data), len(self.salary_data)) * 100\n",
    "        print(f\"   📊 Match rate: {match_rate:.1f}%\")\n",
    "        \n",
    "        return direct_matches, employment_only, salary_only\n",
    "    \n",
    "    def calculate_combined_score(self, employment_data: Dict, salary_data: Dict) -> Dict:\n",
    "        \"\"\"Calculate combined career recommendation score\"\"\"\n",
    "        try:\n",
    "            # Employment factors\n",
    "            emp_growth = employment_data.get('growth_total_percent', 0)\n",
    "            emp_quality = employment_data.get('quality_rating', 'POOR')\n",
    "            \n",
    "            # Salary factors\n",
    "            current_salary = salary_data['current_metrics']['median_salary']\n",
    "            sal_growth = float(salary_data['forecasts']['forecast_growth_rate'].rstrip('%'))\n",
    "            sal_quality = salary_data['model_quality']['quality_rating']\n",
    "            \n",
    "            # Scoring system\n",
    "            score = 0\n",
    "            \n",
    "            # Employment growth scoring\n",
    "            if emp_growth > 20: score += 4\n",
    "            elif emp_growth > 10: score += 3\n",
    "            elif emp_growth > 0: score += 2\n",
    "            elif emp_growth > -10: score += 1\n",
    "            \n",
    "            # Salary level scoring\n",
    "            if current_salary > 100000: score += 4\n",
    "            elif current_salary > 75000: score += 3\n",
    "            elif current_salary > 50000: score += 2\n",
    "            elif current_salary > 35000: score += 1\n",
    "            \n",
    "            # Salary growth scoring\n",
    "            if sal_growth > 4: score += 3\n",
    "            elif sal_growth > 2: score += 2\n",
    "            elif sal_growth > 0: score += 1\n",
    "            \n",
    "            # Quality bonus\n",
    "            if emp_quality == 'EXCELLENT' and sal_quality == 'EXCELLENT':\n",
    "                score += 2\n",
    "            elif emp_quality in ['EXCELLENT', 'GOOD'] and sal_quality in ['EXCELLENT', 'GOOD']:\n",
    "                score += 1\n",
    "            \n",
    "            # Overall recommendation\n",
    "            if score >= 10:\n",
    "                overall = \"🌟 OUTSTANDING CAREER CHOICE\"\n",
    "                description = \"Excellent employment growth + high salary potential + reliable forecasts\"\n",
    "            elif score >= 8:\n",
    "                overall = \"🚀 EXCELLENT CAREER CHOICE\"\n",
    "                description = \"Strong employment prospects + good salary potential\"\n",
    "            elif score >= 6:\n",
    "                overall = \"✅ STRONG CAREER CHOICE\"\n",
    "                description = \"Good overall prospects with solid growth potential\"\n",
    "            elif score >= 4:\n",
    "                overall = \"🟨 MODERATE CAREER CHOICE\"\n",
    "                description = \"Decent prospects but with some limitations\"\n",
    "            else:\n",
    "                overall = \"⚠️ CHALLENGING CAREER CHOICE\"\n",
    "                description = \"Limited growth or lower salary potential\"\n",
    "            \n",
    "            return {\n",
    "                'combined_score': score,\n",
    "                'max_score': 13,\n",
    "                'overall_recommendation': overall,\n",
    "                'description': description,\n",
    "                'employment_growth': f\"{emp_growth:+.1f}%\",\n",
    "                'salary_level': f\"${current_salary:,}\",\n",
    "                'salary_growth': f\"{sal_growth:+.1f}%\"\n",
    "            }\n",
    "            \n",
    "        except Exception as e:\n",
    "            return {\n",
    "                'combined_score': 0,\n",
    "                'overall_recommendation': \"❓ INSUFFICIENT DATA\",\n",
    "                'description': f\"Error calculating combined score: {e}\"\n",
    "            }\n",
    "    \n",
    "    def create_integrated_database(self):\n",
    "        \"\"\"Create the final integrated database\"\"\"\n",
    "        print(\"\\n🚀 Creating integrated career database...\")\n",
    "        \n",
    "        direct_matches, employment_only, salary_only = self.find_matches()\n",
    "        \n",
    "        # Process complete matches (both employment and salary)\n",
    "        complete_careers = 0\n",
    "        for match in direct_matches:\n",
    "            career_profile = {\n",
    "                'occ_code': match['occ_code'],\n",
    "                'occ_title': match['occ_title'],\n",
    "                'has_employment_forecast': True,\n",
    "                'has_salary_forecast': True,\n",
    "                'last_updated': datetime.now().isoformat(),\n",
    "                'data_completeness': 'COMPLETE',\n",
    "                'employment': match['employment_data'],\n",
    "                'salary': match['salary_data'],\n",
    "                'complete_career_analysis': {\n",
    "                    'overall_recommendation': '🌟 COMPLETE CAREER DATA AVAILABLE',\n",
    "                    'employment_outlook': match['employment_data'].get('recommendation', 'Available'),\n",
    "                    'salary_outlook': match['salary_data']['student_guidance']['overall_recommendation'],\n",
    "                    'combined_score': self.calculate_combined_score(match['employment_data'], match['salary_data'])\n",
    "                }\n",
    "            }\n",
    "            \n",
    "            # Use OCC_CODE as the key for consistency\n",
    "            self.integrated_database[match['occ_code']] = career_profile\n",
    "            complete_careers += 1\n",
    "        \n",
    "        # Process employment-only forecasts\n",
    "        employment_only_count = 0\n",
    "        for emp_job in employment_only:\n",
    "            career_profile = {\n",
    "                'occ_code': emp_job['occ_code'],\n",
    "                'occ_title': emp_job['occ_title'],\n",
    "                'has_employment_forecast': True,\n",
    "                'has_salary_forecast': False,\n",
    "                'last_updated': datetime.now().isoformat(),\n",
    "                'data_completeness': 'EMPLOYMENT_ONLY',\n",
    "                'employment': emp_job['employment_data'],\n",
    "                'employment_only_note': 'Salary forecast not available for this occupation'\n",
    "            }\n",
    "            \n",
    "            self.integrated_database[emp_job['occ_code']] = career_profile\n",
    "            employment_only_count += 1\n",
    "        \n",
    "        # Process salary-only forecasts\n",
    "        salary_only_count = 0\n",
    "        for sal_job in salary_only:\n",
    "            # Generate a unique key for salary-only jobs\n",
    "            if sal_job['occ_code']:\n",
    "                key = sal_job['occ_code']\n",
    "            else:\n",
    "                key = f\"SAL_{salary_only_count:04d}\"\n",
    "            \n",
    "            career_profile = {\n",
    "                'occ_code': sal_job['occ_code'],\n",
    "                'occ_title': sal_job['occ_title'],\n",
    "                'has_employment_forecast': False,\n",
    "                'has_salary_forecast': True,\n",
    "                'last_updated': datetime.now().isoformat(),\n",
    "                'data_completeness': 'SALARY_ONLY',\n",
    "                'salary': sal_job['salary_data'],\n",
    "                'salary_only_note': 'Employment forecast not available for this occupation'\n",
    "            }\n",
    "            \n",
    "            self.integrated_database[key] = career_profile\n",
    "            salary_only_count += 1\n",
    "        \n",
    "        print(f\"✅ Integrated database created:\")\n",
    "        print(f\"   🎯 Complete career profiles: {complete_careers:,}\")\n",
    "        print(f\"   📈 Employment-only profiles: {employment_only_count:,}\")\n",
    "        print(f\"   💰 Salary-only profiles: {salary_only_count:,}\")\n",
    "        print(f\"   📊 Total profiles: {len(self.integrated_database):,}\")\n",
    "        \n",
    "        return self.integrated_database\n",
    "    \n",
    "    def save_integrated_database(self, filename: str = 'final_integrated_career_database.json'):\n",
    "        \"\"\"Save the final integrated database\"\"\"\n",
    "        if not self.integrated_database:\n",
    "            print(\"❌ No integrated database to save\")\n",
    "            return False\n",
    "        \n",
    "        # Create comprehensive metadata\n",
    "        complete_careers = sum(1 for job in self.integrated_database.values() \n",
    "                             if job['has_employment_forecast'] and job['has_salary_forecast'])\n",
    "        employment_only = sum(1 for job in self.integrated_database.values() \n",
    "                            if job['has_employment_forecast'] and not job['has_salary_forecast'])\n",
    "        salary_only = sum(1 for job in self.integrated_database.values() \n",
    "                        if not job['has_employment_forecast'] and job['has_salary_forecast'])\n",
    "        \n",
    "        database = {\n",
    "            'metadata': {\n",
    "                'created_date': datetime.now().isoformat(),\n",
    "                'integration_version': 'Career Database Integrator v1.0',\n",
    "                'total_career_profiles': len(self.integrated_database),\n",
    "                'complete_careers': complete_careers,\n",
    "                'employment_only_careers': employment_only,\n",
    "                'salary_only_careers': salary_only,\n",
    "                'integration_success_rate': f\"{(complete_careers / len(self.integrated_database)) * 100:.1f}%\",\n",
    "                'data_sources': {\n",
    "                    'employment_forecasts': 'complete_employment_forecasts.json',\n",
    "                    'salary_forecasts': 'complete_integrated_career_database.json'\n",
    "                },\n",
    "                'search_capability': 'Supports comprehensive career searches with employment and/or salary data',\n",
    "                'student_guidance': 'Complete career recommendations with combined scoring'\n",
    "            },\n",
    "            'careers': self.integrated_database\n",
    "        }\n",
    "        \n",
    "        try:\n",
    "            with open(filename, 'w') as f:\n",
    "                json.dump(database, f, indent=2, default=str)\n",
    "            \n",
    "            file_size_mb = len(json.dumps(database)) / (1024 * 1024)\n",
    "            \n",
    "            print(f\"\\n💾 FINAL DATABASE SAVED: {filename}\")\n",
    "            print(f\"📊 Contains: {len(self.integrated_database):,} career profiles\")\n",
    "            print(f\"🎯 Complete careers: {complete_careers:,} ({(complete_careers/len(self.integrated_database))*100:.1f}%)\")\n",
    "            print(f\"📁 File size: ~{file_size_mb:.1f} MB\")\n",
    "            \n",
    "            return True\n",
    "            \n",
    "        except Exception as e:\n",
    "            print(f\"❌ Error saving database: {e}\")\n",
    "            return False\n",
    "    \n",
