    "Industry Standard (MAPE <15%): {sum(1 for mape in all_mapes if mape <= 15)/len(all_mapes)*100:.0f}%\n",
    "High-Quality Forecasts (R² >0.6): {sum(1 for r2 in all_r2s if r2 >= 0.6)/len(all_r2s)*100:.0f}%\n",
